import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card'
import './index.css'
import object from './Object'


ReactDOM.render(
  <>
  <hl className="heading-style">list of 5 netflix super seires</hl>

   <Card 
   imgsrc={object[0].imgsrc}
   title={object[0].title}
   sname={object[0].sname}
   links={object[0].link}
   />
   <Card 
   imgsrc={object[1].imgsrc}
   title={object[1].title}
   sname={object[1].sname}
   links={object[1].link}
   />
   <Card 
   imgsrc={object[2].imgsrc}
   title={object[2].title}
   sname={object[2].sname}
   links={object[2].link}
   />
  </>
  ,document.getElementById('root')
);
